                <iframe width="1024" height="576" src="https://www.youtube.com/embed/6oj8tNjwR68" title="Atlassian + Kiva: The Teams Behind Global Impact | Atlassian" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen controls autoplay></iframe>
            </div>
        </Fragment>
    ) ;

}export default Video;
